import React from "react";
import { Link, NavLink } from "react-router-dom";

const Header = () => {
  return (
    <div className="header">
      <div className="top__header">
        <p>Telefon: 091 - 390 / 5524</p>
        <p>E-mail: info@msk.hr</p>
      </div>
    </div>
  );
};

export default Header;
